import sys
import base64
import traceback

#NOTE: This Is A Base64 Encoded String...
data = '''

'''

try:
	byte_data = base64.b64decode(data)                                              #Decode Base64 String Request...

	file = open('Base64 Decode String to PDF and Save File.pdf', 'wb')
	file.write(byte_data)
	file.close()
except Exception as e:
	print('Exception: ' + str(e))
	print(' ')
	exc_type, exc_value, exc_traceback = sys.exc_info()
	print('Type: ' + exc_type.__name__)
	print('Name: ' + exc_traceback.tb_frame.f_code.co_name)
	print('Line: ' + str(exc_traceback.tb_lineno) )


print(' ')
print('Process Completed...')
print(' ')